function ControlPirateBoot(){
	
	if(boot == true){
		boot = false;
		(debug)?alert("Pirate Boot OFF"):"";
		setCookie("IKPT_PirateStatus",0,365);
		$(".IKPT_MenuPirate").find('.IKPT_namebox').html("Pirate Boot OFF");
	}else{
		boot = true;
		(debug)?alert("Pirate Boot ON"):"";
		setCookie("IKPT_PirateStatus",1,365);
		$(".IKPT_MenuPirate").find('.IKPT_namebox').html("Pirate Boot ON");
	}
}

function ControlPirateCrew(){
	
	if(crew == true){
		crew = false;
		(debug)?alert("Crew Boot OFF"):"";
		setCookie("IKPT_CrewStatus",0,365);
		$(".IKPT_MenuCrew").find('.IKPT_namebox').html("Crew Boot OFF");
	}else{
		crew = true;
		(debug)?alert("Crew Boot ON"):"";
		setCookie("IKPT_CrewStatus",1,365);
		$(".IKPT_MenuCrew").find('.IKPT_namebox').html("Crew Boot ON");
	}
}

function StartBot(){
	(debug)?alert("Boot is "+boot):"";
	//gravando status
	setCookie("IKPT_Info",getInfoIKPT(),365);
	//$('#IKPT_debug').html(checkCookie("IKPT_Info")+'<br> flag: '+useAllFlag+' bonus: '+useBonus+' time: '+time+' producao: '+producao+'<br> boot: '+boot+' crew: '+crew);
	
	if($("#position17").hasClass("pirateFortress")){
		if(boot == true || crew == true){
			if($("#pirateCaptureBox").html() != undefined) {
				if(boot == true){
					//abre aba
					//ajaxHandlerCall('?view=pirateFortress&amp;activeTab=tabBootyQuest&amp;cityId=45017&amp;position=17');
					var hrefBotao = $("a.capture", "#pirateCaptureBox");
					//verifica se esta em missao
					if($('body').find('#missionProgressTime').size() < 1){
						ajaxHandlerCall(hrefBotao.attr("href"));
						//setTimeout(function(){location.reload();}, 1000);
					}
				}//fim boot
			
				var produzir = 0;
				if(crew == true){
					bandeira = $('.capturePoints .value').html().replace(',', '');
				
					//usa todas bandeiras
					if(useAllFlag){
						//usa todas bandeiras disponiveis
						produzir = bandeira;
						//bonus pirata 
						if(useBonus){
							//se manter bonus verdade retira quantidade de bandeiras para manter o bonus
							produzir = produzir - bonus;
						} 
						//verifica producao minima
						if ((producao*10)>produzir){
							produzir = 0;
						}
						
					}else{
						//pegar quantidade de bandeira necessaria para producao
						produzir = producao * 10;
						if(useBonus){
							//se manter bonus verdade, verifica se bonus mais bandeiras necessarias para producao
							//e maior que bandeiras disponiveis, se for aguarda 
							if(produzir+bonus>bandeira){
								produzir = 0;
							}
						}
						//verifica se a quantidade a ser produzida e maior que a quantidade de bandeiras diponiveis
						if(produzir > bandeira){
							produzir = 0;
						}
					}
					if (produzir <= 0){
						produzir = 0;
					}
	
					//converter para numero de pirata
					produzir = parseInt(produzir / 10);
	
					$('#IKPT_FlagNext').html(produzir * 10 - $('#IKPT_Flag').html());
					$('#IKPT_CrewNext').html(produzir - $('#IKPT_Crew').html());
				
					//abre aba
					//ajaxHandlerCall('?view=pirateFortress&activeTab=tabCrew&cityId=45017&position=17');
					if (produzir > 0){ 
		
						//verifica se esta produzindo   
						if($('body').find('#conversionProgressBar').size() < 1){
							(debug)?alert("Bandeiras: "+ bandeira):"";
							// informa crew no input
							$('#CPToCrewInput').val(produzir);
							// manda produzir
							ajaxHandlerCallFromForm($("#CPToCrewForm").get(0));
			
							$('#IKPT_Flag').html(produzir * 10);
							$('#IKPT_Crew').html(produzir);
							
							var qtSecs = produzir * 7 + 156;
			
							$('#IKPT_CrewFinishTime').html(getTimeString(qtSecs));
						}
					} 
				}//fim crew
			}else{
				if(boot == true || crew == true){
					//abre janela
					ajaxHandlerCall($("#js_CityPosition17Link").attr("href"));
				}
			}
		}
	}
	//recarrega pagina para evitar travamento de interface
	if(ciclo > 100){
		ciclo = ciclo + 1;
		setTimeout(function(){location.reload();}, 1000);
	}else{
		ciclo = 0;
	}
}

function getInfoIKPT(){
	var IKPT_Object = new Object();
	IKPT_Object.Interval = $('#IKPT_cbb_Inteval option:selected').val();
	time = $('#IKPT_cbb_Inteval option:selected').val()*1000;
	
	if($('#IKPT_chk_UseFlag').attr('checked')){
		IKPT_Object.UseFlag = true;
		useAllFlag = true;
	}else{
		IKPT_Object.UseFlag = false;
		useAllFlag = false;
	}
	if($('#IKPT_chk_Bonus').attr('checked')){
		IKPT_Object.Bonus = true;
		useBonus = true;
	}else{
		IKPT_Object.Bonus = false;
		useBonus = false;
	}	
	IKPT_Object.Crew = $('#IKPT_txb_Crew').val();
	IKPT_Object.Producao = $('#IKPT_txb_Crew').val();
	IKPT_Object.Producting = Array($('#IKPT_Flag').html(), $('#IKPT_Crew').html(), $('#IKPT_CrewFinishTime').html());
	
	//IKPT_Object.producting = { "flag" : $('#IKPT_Flag').html(); , "crew" : $('#IKPT_Crew').html(), "endTime" : $('#IKPT_CrewFinishTime').html() };
	
	//$('#IKPT_debug').html('flag: '+useAllFlag+' bonus: '+useBonus+' time: '+time+' producao: '+producao	);
	
	var jsonText = JSON.stringify(IKPT_Object, "", "");
	return jsonText;
}

function getTimeString(seconds){
	var date = new Date ($.now()+seconds*1000);
	// hours part from the timestamp
	var hours = date.getHours();
	// minutes part from the timestamp
	var minutes = date.getMinutes();
	// seconds part from the timestamp
	var seconds = date.getSeconds();
	var day = date.getDate();
	var month = date.getMonth()+1;
	var year = date.getFullYear();

	// will display time in 10:30:23 format
	var formattedTime = hours + ':' + minutes + ':' + seconds + ' ' + day + '/' + month + '/' + year;
	return formattedTime;
}

/***********************************************************************************************************************
 * Cookies
 **********************************************************************************************************************/
function setCookie(c_name,value,exdays){
	var exdate=new Date();
	exdate.setDate(exdate.getDate() + exdays);
	var c_value=escape(value) + ((exdays==null) ? "" : "; expires="+exdate.toUTCString());
	document.cookie=c_name + "=" + c_value;
	(debug)?alert('Salvando Cookie -'+value):"";
}

function getCookie(c_name){
	var i,x,y,ARRcookies=document.cookie.split(";");
	for (i=0;i<ARRcookies.length;i++){
		x=ARRcookies[i].substr(0,ARRcookies[i].indexOf("="));
		y=ARRcookies[i].substr(ARRcookies[i].indexOf("=")+1);
		x=x.replace(/^\s+|\s+$/g,"");
		if (x==c_name)
		{
			return unescape(y);
		}
	}
}

function checkCookie(c_name){
	var status=getCookie(c_name);
	if (status!=null && status!=""){
		//alert("Welcome again " + username);
		(debug)?alert('Cookie '+c_name+' recuperado - '+status):"";
		return status;
	}else{
		//username=prompt("Please enter your name:","");
		if (boot!=null && boot!=""){
			if(boot == true){
				setCookie(c_name,1,365);
			} else {
				setCookie(c_name,0,365);
			}
			return "";
		}
	}
}
